    "sensitivity-of-coastal-environments-and-wildlife-to-spilled-oil-central-california-birds-bird-p",nt"isopen":
    false,nt"url": null,nt"notes": "This data set contains sensitive biological
    resource data for alcids, diving birds, gulls, terns, passerine birds, pelagic birds,
    raptors, shorebirds, wading birds, and waterfowl in Central California. Vector polygons
    in this data set represent nesting and roosting sites, rare species occurrences,
    and concentration areas. Species-specific abundance, seasonality, status, life history,
    and source information are stored in relational data tables (described below) designed
    to be used in conjunction with this spatial data layer.This data set comprises a
    portion of the Environmental Sensitivity Index (ESI) data for Central California.
    ESI data characterize the marine and coastal environments and wildlife by their
    sensitivity to spilled oil. The ESI data include information for three main components:
    shoreline habitats, sensitive biological resources, and human-use resources. See
    also the NESTS (Nest Points) data layer, part of the larger Central California ESI
    database, for additional bird information.",nt"license_title": null,nt"extras":
